function Test2(props){
   return(
       <div style={{backgroundColor:props.color, width:"600px", height:"300px",textAlign:"center", transition:"2s", borderRadius:"100px",marginLeft:"500px"}} >
          
           <h1>Name={props.data}  </h1>
         <h2>DOB={props.fo}</h2>  
         <h3>AGE={props.co}</h3>
         <h4> COURSE={props.course}</h4>
       </div>
   )
}
export default Test2;
